    <script>
        $('#insert_lab').on('click', function () {

            if ($('#lab_item_name').val() == '') {

                alert('Please type in a value')

            } else {

                $('#add_lab_items').modal('hide');
                $('#modal-auth').modal('show');

                var lab_item_name = $('#lab_item_name').val();

                $.ajax({

                    url: "../includes/inc.processes.php",
                    method: "POST",
                    data: {
                        "add_lab_item": "add_lab_item",
                        "lab_item_name": lab_item_name
                    },

                    success: function (data) {

                        if (data == "SUCCESS") {

                            $('.disappear').addClass('invisible');
                            $('.wrong').addClass('invisible');
                            $('.change').addClass('visible');
                            setTimeout('$("#modal-auth").modal("hide")', 1000);

                        } else if (data == 'IN_ALREADY') {

                            $('.disappear').addClass('invisible');
                            $('.change').addClass('invisible');
                            $('.wrong').addClass('invisible');
                            $('.waiting').addClass('visible');
                            setTimeout("$('#modal-auth').modal('hide')", 2000);
                        } else {

                            $('.disappear').addClass('invisible');
                            $('.change').addClass('invisible');
                            $('.wrong').addClass('visible');
                            setTimeout("$('#modal-auth').modal('hide')", 1000);

                        }

                    }

                })

            }


        });

        function print(printRecord) {
            var printContents = document.getElementById("printRecord").innerHTML;
            var w = window.open();
            w.document.write(printContents);
            w.focus();
            w.print();
            w.close();
            window.location.reload();

        }
    </script>
